import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { batchLayout, motion, useMotionValue } from "framer-motion";

const Button = styled(motion.button)`
  padding: 1rem 3rem;
  font-size: 1rem;
  border: 2px solid #fff;
  border-radius: 4px;
  outline: none;
  cursor: pointer;
  background: transparent;
  color: #fff;
`;

let user;

const join = () => {
  const sendUser = () => {
    user = document.getElementById("joinInput").value;
  };
  const move = () => {
    console.log("hie");
    window.scrollTo({ top: 850.5, behavior: "smooth" });
  };
  return (
    <div>
      <div>
        <input id="joinInput" placeholder="Enter Name" />
      </div>
      {/* padding: 8px; width: 171px; border: none; background: transparent; color:
      white; */}
      <div>
        <Link to="/chat">
          <Button
            onClick={sendUser}
            whileHover={{ scale: 1.05 }}
            whileTap={{
              scale: 0.9,
              backgroundColor: "#67f6e7",
              border: "none",
            }}
          >
            Go And Chat
          </Button>
        </Link>
        <Button
          onClick={move}
          whileHover={{ scale: 1.05 }}
          whileTap={{
            scale: 0.9,
            backgroundColor: "#67f6e7",
            border: "none",
          }}
        >
          About Aditya Barve
        </Button>
      </div>
    </div>
  );
};

export default join;
export { user };
